import React, { Component } from 'react'

export default class Character extends Component {
    render() {
        return (
            <div>
            <div className='card'>
            <h1>{this.props.charName}</h1>
            <img src={this.props.charImg} alt=""/>
            <h3>{this.props.founder}</h3>

            </div>
            </div>
        )
    }
}
